import React, {Component} from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        Hello, world
        <FirstComponent />
      </div>
    );
  }
}

class FirstComponent extends Component {
  render() {
    return (
      <div className="FirstComponent">
        FirstComponent
      </div>
    );
  }
}

